import React from "react";
import { DragDropContext, Droppable } from 'react-beautiful-dnd';

const Drag = () => {
  return (
    <div>
      <h1>Drag</h1>
      <DragDropContext>
  <Droppable droppableId="characters">
    {(provided) => (
      <ul className="characters" {...provided.droppableProps} ref={provided.innerRef}>
        
      </ul>
    )}
  </Droppable>
</DragDropContext>
    </div>
  );
};

export default Drag;
